import React, { Component } from "react";


class PlayBar extends Component {
    constructor(props) {
        super(props);
    }

    render(){
        return(
            <div>
                <audio src={this.props.mp3Url} style={{visibility: "hidden"}}></audio>

            </div>
        )
    }
}

export  default PlayBar;
